// ========== æ„å»º emoji åˆ—è¡¨ ==========
function buildEmojiList() {
  const allEmojis = new Set([...Object.keys(EMOJI_EN), ...Object.keys(EMOJI_ZH)])
  const items = []
  let idx = 0
  
  for (const emoji of allEmojis) {
    const enKeywords = EMOJI_EN[emoji] || []
    const zhKeywords = EMOJI_ZH[emoji] || []
    
    // è·³è¿‡çº¯ç¬¦å·ï¼ˆé emojiï¼‰
    if (emoji.length === 1 && emoji.charCodeAt(0) < 256) continue
    
    // æ„å»ºæœç´¢ç”¨çš„æè¿°ï¼ˆåŒ…å«æ‰€æœ‰å…³é”®è¯ï¼‰
    const enText = enKeywords.slice(0, 5).join(' ')
    const zhText = zhKeywords.slice(0, 5).join(' ')
    
    // æ˜¾ç¤ºç”¨çš„æè¿°ï¼ˆç®€çŸ­ï¼‰
    const enDisplay = enKeywords.slice(0, 3).join(', ')
    const zhDisplay = zhKeywords.slice(0, 3).join(', ')
    let description = ''
    if (enDisplay && zhDisplay) {
      description = enDisplay + ' / ' + zhDisplay
    } else if (enDisplay) {
      description = enDisplay
    } else if (zhDisplay) {
      description = zhDisplay
    }
    
    items.push({
      title: emoji + ' ' + enText + ' ' + zhText,  // æœç´¢ç”¨
      description: description,                      // æ˜¾ç¤ºç”¨
      emoji: emoji,
      idx: idx++
    })
  }
  
  return items
}

// ========== ä¸»é€»è¾‘ ==========
const items = buildEmojiList()

quickcommand.showSelectList(items, {
  placeholder: 'è¾“å…¥å…³é”®è¯æœç´¢ emoji (' + items.length + ' ä¸ª)',
  optionType: 'json'
}).then(selected => {
  if (selected !== undefined && selected !== null) {
    let emoji = ''
    if (selected.emoji) {
      emoji = selected.emoji
    } else if (selected.idx !== undefined && items[selected.idx]) {
      emoji = items[selected.idx].emoji
    } else if (selected.title) {
      // title æ ¼å¼æ˜¯ "emoji keywords..."ï¼Œå–ç¬¬ä¸€ä¸ªå­—ç¬¦ï¼ˆå¯èƒ½æ˜¯å¤šå­—èŠ‚ emojiï¼‰
      emoji = selected.title.split(' ')[0]
    }
    
    if (emoji) {
      utools.copyText(emoji)
      utools.showNotification('å·²å¤åˆ¶: ' + emoji)
    }
  }
  exitPlugin()
})
